&quot;AL CONSULTAR LA INFORMACIÓN CON SU NÚMERO DE DOCUMENTO NO SE ENCUENTRA REGISTRADO(A) Y EN ESTADO ACTIVO PARA LA LÍNEA DE VALORACIÓN DEL CUIDADO DENTRO DEL PROGRAMA RENTA CIUDADANA. 
POR LO ANTERIOR, POR FAVOR, ESTÉ PENDIENTE DE LOS NUEVOS PROCESOS DE SELECCIÓN QUE SE ADELANTAN POR PARTE DE PROSPERIDAD SOCIAL PARA LAS DIFERENTES LÍNEAS DE INTERVENCIÓN. TENER EN CUENTA QUE NO SE REALIZARÁN PROCESOS DE CONVOCATORIAS E INSCRIPCIONES, SINO QUE PROSPERIDAD SOCIAL ADELANTA LA IDENTIFICACIÓN, SELECCIÓN Y VINCULACIÓN DE LOS HOGARES POTENCIALES BENEFICIARIOS A TRAVÉS DE REGISTROS ADMINISTRATIVOS DE LAS FUENTES OFICIALES, POR LO QUE PARA MAYOR INFORMACIÓN LE RECOMIENDO ESTAR PENDIENTE A TRAVÉS DE NUESTROS CANALES DE ATENCIÓN OFICIALES: TELEFÓNICO, VIRTUAL, PÁGINA WEB Y REDES SOCIALES.&quot;



&quot;RENTA CIUDADANA ES UN PROGRAMA CUYO OBJETIVO ES CONTRIBUIR A LA SUPERACIÓN DE LA POBREZA, FOMENTAR LA MOVILIDAD SOCIAL Y FORTALECER LA ECONOMÍA POPULAR. PARA ELLO, SE ENTREGAN TRANSFERENCIAS MONETARIAS CONDICIONADAS Y NO CONDICIONADAS A HOGARES EN POBREZA EXTREMA Y MODERADA (GRUPOS A Y B DEL SISBÉN IV).
ACTUALMENTE LA LÍNEA DE INTERVENCIÓN DE LA CUAL SE ESTÁ REALIZANDO EL ACOMPAÑAMIENTO ES VALORACIÓN DEL CUIDADO LA CUAL ATIENDE A HOGARES MONOPARENTALES EN GRUPO A DEL SISBÉN IV QUE TENGAN NIÑOS Y NIÑAS MENORES DE 6 AÑOS O PERSONAS CON DISCAPACIDAD QUE REQUIERAN CUIDADO.
RENTA CIUDADANA, NO TIENE PROCESOS DE CONVOCATORIA E INSCRIPCIÓN, SINO QUE PROSPERIDAD SOCIAL ADELANTA LA IDENTIFICACIÓN, SELECCIÓN Y VINCULACIÓN DE POTENCIALES BENEFICIARIOS A TRAVÉS DE APLICACIÓN DE CRITERIOS DE ENTRADA Y LA INFORMACIÓN DEL HOGAR REGISTRADA EN LAS FUENTES OFICIALES PARA EL PROCESO DE SELECCIÓN DE LOS CIUDADANOS, QUE DETERMINA SI SE PUEDE SER BENEFICIARIO DEL PROGRAMA.
LE INVITAMOS A MANTENER ACTUALIZADOS LOS DATOS DE SU HOGAR EN SU CENSO POBLACIONAL CON SU AUTORIDAD INDÍGENA O SISBÉN IV Y ESTAR PENDIENTE POR MEDIO DE NUESTROS CANALES DE ATENCIÓN OFICIALES, TELEFÓNICO, VIRTUAL, PÁGINA WEB Y REDES SOCIALES, PARA OBTENER MÁS INFORMACIÓN.&quot;

AL REVISAR EL SISTEMA DE INFORMACIÓN, SE ENCONTRÓ QUE USTED ADELANTÓ UN PRE-REGISTRO EN LAS CONVOCATORIAS DE LA VIGENCIA 2024, SIN EMBARGO, DE ACUERDO CON LA ASIGNACIÓN PRESUPUESTAL PARA EL AÑO 2025, NO FUE POSIBLE OTORGAR INSCRIPCIONES AL PROGRAMA. EN CONSECUENCIA, SU ESTADO CAMBIÓ A REGISTRO VENCIDO.
ES IMPORTANTE ACLARAR QUE, EL ESTADO MENCIONADO NO LO HACE UN PARTICIPANTE ACTIVO EN EL PROGRAMA, POR LO TANTO, NO ES SUSCEPTIBLE DE VERIFICACIÓN DE COMPROMISOS NI DE ENTREGA DE TRANSFERENCIAS MONETARIAS CONDICIONADAS.
POR LA ANTERIOR LE INVITAMOS A MANTENER SUS DATOS ACTUALIZADOS EN LA BASE DE POBLACIÓN VULNERABLE A LA QUE PERTENECE, POR SI SE LLEGA A AUTORIZAR UN NUEVO PROCESO DE INSCRIPCIONES, LO QUE SE INFORMARÁ A TRAVÉS DE LOS CANALES DE COMUNICACIÓN OFICIALES DE PROSPERIDAD SOCIAL.&quot;

&quot;ES UN GUSTO INFORMARLE QUE EL INCENTIVO CORRESPONDIENTE AL CICLO 2 DE 2025 DEL PROGRAMA RENTA JOVEN, CORRESPONDIENTE A 2024-2 R2 - REPORTE DE PERMANENCIA Y EXCELENCIA, POR UN MONTO DE $600,000, HA SIDO AUTORIZADO PARA PAGO MEDIANTE LA MODALIDAD DE GIRO.

EFECTY	OLIMPICA CIUDAD CORDOBA	CALI	VALLE DEL CAUCA	

SI TIENE ALGUNA DUDA, NO DUDE EN CONTACTARNOS A TRAVÉS DE NUESTROS CANALES DE ATENCIÓN OFICIALES: LÍNEA TELEFÓNICA, ATENCIÓN VIRTUAL, PÁGINA WEB Y REDES SOCIALES.&quot;

